import { type } from "@testing-library/user-event/dist/type";
import React from "react";

export default function LoginForm({ typeOfForm }) {
  return (
    <div className="form">
      <form>
        {typeOfForm === "login" ? (
          <div>
            <div>Login</div>
            <div>New to CryptoWatch?</div>
          </div>
        ) : (
          <div>Sign Up</div>
        )}
        <div>Log In</div>
        <div></div>
        <div></div>
      </form>
    </div>
  );
}
